import React from 'react';
import { Form, Input, Button, Radio } from 'antd';

function Relatorio(){
    return(
        <div>
            <Form
                ame="basic"
                labelCol={{ span: 8 }}
                wrapperCol={{ span: 16 }}
                initialValues={{ remember: true }}
            >
                <Form.Item
                    label="Username"
                    name="username"
                >
                    <Radio value={1}>Mestrado</Radio>
                    <Radio value={2}>Doutorado</Radio>
                </Form.Item>
            </Form>
        </div>
    )
}

export default Relatorio
